import React ,{ useState } from "react";
import Register from "./Register";
import Country from "./Country";
import State from "./State";
function App() {

  const [Page, x] = useState('Register');

  const display = () =>{
    if(Page == 'Register'){
      return <Register Pages={x}  />;
    }else if(Page == 'Country'){
      return <Country Pages={x}  />;
    }else if(Page == 'State'){
      return <State Pages={x}  />;
    }
  }


  return (
    display()
 ); 
}

export default App;
